SEZSB As screen:
    OnVisible: |-
        =Select(btnSummarySEZSB);UpdateContext({varShowSubmenu:false})

    Navigation_8 As Navigation:
        ApplicationHeader: ="AI EXIM OCR"
        Height: =768
        NavigationItems: |-
            =Table(
                {
                    Title: "Home",
                    Screen: Home
                    //Icon: true
                },
                {
                    Title: "Documents",
                    Screen: Documents
                    //Icon: true
                },
                {
                    Title: "Extracted Data",
                    Screen: 'Extracted Data'
                },
                {
                    Title: "Reports",
                    Screen: Reports
                },
                {
                    Title: "Logs",
                    Screen: Logs
                },
                {
                    Title: "User Access",
                    Screen: 'User Access'
                }
            )
        ZIndex: =1

    ReportBtn_SEZSB As button:
        Align: =Align.Left
        Color: = RGBA(0, 0, 0, 0)
