        RadiusBottomRight: =0
        RadiusTopLeft: =0
        RadiusTopRight: =0
        Size: =12
        Text: =""
        Width: =196
        X: =7
        Y: =185
        ZIndex: =2

    LogsBtn_SEZSB As button:
