                VarSpinner,
                true
            );
            If(
                IsBlank(
                    LookUp(
                        'Export SEZ - Shipping Summary Reports',
                        ID = varExtractedSEZExportItem,
                        'INV No'
                    )
                ) = true,
                UpdateContext({PopupDocumentNoEntry: true}),
                Set(
                    VarDMDResult,
                    DMSEntryFromApplication.Run(
                        LookUp(
                            'Export SEZ - Shipping Summary Reports',
                            ID = varExtractedSEZExportItem,
                            'INV No'
                        ),
                        LookUp(
                            'Export SEZ - Shipping Summary Reports',
                            ID = varExtractedSEZExportItem
                        ).'SB NO',
                        "SEZ Shipping Bill",
                        "E",
                        LookUp(
                            'Export SEZ - Shipping Summary Reports',
                            ID = varExtractedSEZExportItem
                        ).'Uploaded Doc List IDSEZSB',
                        LookUp(
                            'Export SEZ - Shipping Summary Reports',
                            ID = varExtractedSEZExportItem
                        ).ID
                    ).result
                )
            );
            Set(
                VarSpinner,
                false
            );
            If(
                VarDMDResult = "1",
                Notify(
                    "The document successfully uploaded to DMS.",
                    NotificationType.Success
                ),
                Notify(
                    "The processe failed. Please try again.",
                    NotificationType.Error
                )
            )
